export default function Todo({ name }) {
  return (
    <ListGroupItem>
      <InputGroup>
        <InputGroup.Checkbox />
        <InputGroup.Text>
          {name}
        </InputGroup.Text></InputGroup>
    </ListGroupItem>
  )
}
